import { Link } from 'react-router-dom';
import './movielist.css';

const MovieList = ({ movies }) => {
  return (
    <div>
      {movies.map(movie => (

        <div className="blog-preview" key={movie.id} >
          <Link to={`/blogs/${movie.id}/${movie.title}`}>
            <h2>{ movie.title }</h2>
          </Link>

          <img
                src=""
                alt=""
            />
            <div class="movie-info">
                <h3>${title}</h3>
                <span class="">${vote_average}</span>
            </div>
            <div class="overview">
                <h3>Overview:</h3>
                ${overview}
            </div>    
        </div>
            

      ))}
    </div>
  );
}
 
export default MovieList;
